import React from 'react';

const ImageList =  (props) => {
    const images=props.images.map((image) => {
        return <img src={image.urls.regular} alt={image.description} key={image.id}/>
    })
    return (
        <div className="ui grid">
            <div className="four column wide">{images[0]}</div>
            <div className="four column wide">{images[1]}</div>
            <div className="four column wide">{images[2]}</div>
            <div className="four column wide">{images[3]}</div>
        </div>

    )
}

export default ImageList;
